import { Link } from 'react-router-dom';
import MainNav from './MainNav';

export default function SignUpButton() {
    return (
        <>
        <MainNav />
        <div className=''>
            <Link to="/signup"><button>Sign Up</button></Link>
        </div>
        </>
    )
}
